// src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { FaTools } from 'react-icons/fa';
import { Menu } from '@headlessui/react';

const Dashboard = () => {
  const [maintenanceData, setMaintenanceData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchMaintenanceData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/maintenance');
        console.log(response.data); // Check if data is received here
        setMaintenanceData(response.data);
      } catch (error) {
        console.error("Error fetching maintenance data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchMaintenanceData();
  }, []);

  return (
    <div className="bg-gray-100 min-h-screen p-6">
      <div className="container mx-auto">
        <header className="flex justify-between items-center py-4">
          <h1 className="text-3xl font-bold text-blue-600">Maintenance Dashboard</h1>
          <Menu as="div" className="relative">
            <Menu.Button className="flex items-center px-4 py-2 text-white bg-blue-600 rounded-lg hover:bg-blue-700">
              Options
              <FaTools className="ml-2"/>
            </Menu.Button>
            <Menu.Items className="absolute right-0 mt-2 w-48 bg-white rounded-md shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
              <Menu.Item>
                {({ active }) => (
                  <a href="#" className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100' : ''}`}>
                    Export Data
                  </a>
                )}
              </Menu.Item>
              <Menu.Item>
                {({ active }) => (
                  <a href="#" className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100' : ''}`}>
                    Settings
                  </a>
                )}
              </Menu.Item>
            </Menu.Items>
          </Menu>
        </header>
        
        {loading ? (
          <div className="flex justify-center mt-8">
            <p>Loading data...</p>
          </div>
        ) : (
          <div className="overflow-x-auto bg-white shadow-md rounded-lg">
            <table className="min-w-full bg-white border border-gray-200">
              <thead className="bg-blue-600 text-white">
                <tr>
                  <th className="px-6 py-3 text-left text-sm font-medium uppercase tracking-wider">Machine ID</th>
                  <th className="px-6 py-3 text-left text-sm font-medium uppercase tracking-wider">Model</th>
                  <th className="px-6 py-3 text-left text-sm font-medium uppercase tracking-wider">Next Maintenance Date</th>
                  <th className="px-6 py-3 text-left text-sm font-medium uppercase tracking-wider">Technician Name</th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-200">
                {maintenanceData.map((data) => (
                  <tr key={data._id} className="hover:bg-gray-50">
                    <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">{data.machine_id}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{data.model}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{data.next_maintenance_date}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{data.technician_name}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
